import React from 'react'
import './footer.css'
import { Container, Row, Col, ListGroup, ListGroupItem } from 'reactstrap'
import { Link } from 'react-router-dom'
import logo from '../../assets/images/logo.png'

const quick__links = [
    {
        path: '/home',
        display: 'Home'
    },
    {
        path: '/about',
        display: 'About'
    },
    {
        path: '/tour',
        display: 'Tours'
    },

]
const quick__links2 = [
    {
        path: '/gallery',
        display: 'Gallery'
    },
    {
        path: '/login',
        display: 'Login'
    },
    {
        path: '/resigter',
        display: 'Reisgter'
    },

]

const Footer = () => {
    return (
        <footer className="footer">
            <Container>
                <Row>
                    <Col lg='3'>
                        <div className="logo">
                            <img src={logo} alt="" />
                            <p>TravelWorld là công ty du lịch hàng đầu, chuyên cung cấp các tour du lịch đa dạng và
                                dịch vụ khách hàng chuyên nghiệp. TravelWorld mang đến cho du khách những trải nghiệm độc đáo và đáng nhớ.
                                Cam kết của chúng tôi là tạo ra những hành trình tuyệt vời, đáp ứng mọi nhu cầu của khách hàng.</p>

                            <div className="social__links d-flex align-items-center gap-4">
                                <span></span>
                            </div>
                        </div>
                    </Col>
                </Row>
            </Container>
        </footer>
    )
}

export default Footer
